INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(4, 'DZISIW 2', 'Zdominuj rozgrywk z najnowszym laptopem DZISIW 2. Napdzany procesorem Intel Core 14. generacji (Intel Raptor Lake) i laptopow kart graficzn NVIDIA GeForce RTX serii 40 z atwoci poradzi sobie nawet z najbardziej wymagajcymi grami. MUX Switch z obsug technologii NVIDIA Advanced Optimus zapewni Ci pen moc procesora graficznego. \n', , 'Intel Core i9', '32 ', '1 TB SSD', 'Intel Iris Xe Graphics', 'Brak', 2, 2117, 397);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(5, 'GIGA PRO FULL ULTRA DELUXE', 'Wejd do gry i poczuj, czym jest prawdziwa moc dziki laptopowi GIGA PRO FULL ULTRA DELUXE. W jego stylowej obudowie znajdziesz wycznie najnowoczeniejsze podzespoy. Bezkompromisowy procesor Intel Core 13. generacji w poczeniu z NVIDIA GeForce RTX 40 s gotowe do dziaania. Sprawd, jak wietnie radz sobie w Twoich ulubionych grach. \n', , 'Intel Core i9', '64 ', '512 GB HDD', 'Intel Iris Xe Graphics', 'Windows 11 Professional\n', 2, 9879, 44);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(6, 'LINUXBOOK UBNT 11', 'LINUXBOOK UBNT 11 to wyjtkowy laptop, ktry czy w sobie trzy niezwykle wane cechy: szybko, atwo obsugi\noraz bezpieczestwo.\nW porwnaniu z tradycyjnymi laptopami, ktre czsto wymagaj dugiego czasu uruchomienia i zapewnienia odpowiedniej wydajnoci, ten model zapewnia natychmiastow reakcj i pynn prac.\n', , 'Intel Core i7', '8 ', '100 GB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Home', 2, 9935, 394);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(7, 'Silver Monkey X Battlestation', 'Jeeli szukasz komputera, dziki ktremu rozpoczniesz swoj przygod w grach, to Silver Monkey X Battlestation jest stworzony dla Ciebie. Ten zestaw zaoferuje Ci wszystko, czego potrzebujesz, aby zdoby dowiadczenie i podj prb podboju rankingw w popularnych grach. Zapomnij o dugich czasach adowania i kopotach z pynnoci podczas grania.\n', , 'AMD Ryzen 7', '16 ', '2 TB SSD', 'Intel UHD Graphics', 'Windows 10 Home', 1, 5516, 67);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(8, 'SKYLEND S232', 'Poznaj wydajno, ktra nie boi si wyzwa. SKYLEND S232 to laptop, ktry poradzi sobie z kadymi wyzwaniami, jakie bd na niego czeka w rozgrywkach online. Do tego pracuje cicho i wydajnie, aby zagwarantowa Ci moc w nawet najbardziej wymagajcych grach. Duy ekran z szybkim odwieaniem uatwi Ci namierzenie wroga i zagwarantuje nad nim przewag. \n\n', , 'Intel Core i5', '16 ', '1 TB SSD', 'AMD Radeon Graphics', 'Brak', 2, 7074, 344);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(9, 'CHILL NIGHT 6sTar', 'Poznaj laptop CHILL NIGHT 6sTar, ktry czy w sobie zaawansowan technologi i wygod uytkowania. Ten niezwykle funkcjonalny komputer przenony oferuje Ci bezkompromisow wydajno dziki nowatorskiej architekturze. Ciesz si dugim czasem pracy na baterii, wydajnym przetwarzaniem wielowtkowym oraz grafik, idealn do intensywnych zada.\n', , 'AMD Ryzen 7', '16 ', '240 GB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 11 Home', 2, 7367, 9);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(10, 'WTRBMB FLEX x6A', 'Nasi inynierowie dbaj o to, by kady WTRBMB posiada przetestowane i wydajne komponenty. Dziki temu masz pewno, e otrzymujesz sprzt sprawdzony w boju i zoony z najwyszej jakoci komponentw. Do Ciebie przyjeda komputer gotowy do gry na najwyszych detalach. WTRBMB FLEX i Elite to komputery poprawnie skonfigurowane, starannie zoone, oferujce dobr wydajno.\n', , 'Intel Core i5', '64 ', '512 GB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Professional\n', 1, 5143, 55);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(11, 'Black Pearl A3', 'Gotowy zestaw komputerowy to idealne rozwizanie dla tych, ktrzy nie posiadajc odpowiedniej wiedzy, nie chc ryzykowa doborem podzespow, czy pniejszym zoeniem ich w poprawnie funkcjonujc jednostk. Niestety tzw. gotowce czsto s rwnie puapk zastawion na tych najmniej dowiadczonych uytkownikw, ktrzy nceni wybitnie atrakcyjn cen zupenie nie dostrzegaj, e cz komponentw jest bardzo sabej jakoci.\n', , 'Intel Core i9', '8 ', '2 TB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 11 Home', 1, 8919, 11),
(12, 'Virtual 15XX', 'Virtual 15XX to bardzo uniwersalne urzdzenie. Szukasz sprztu, ktry posuy Ci do pracy biurowej, nauki, czy jako domowe centrum rozrywki? Ten komputer sprawdzi si w kadym z tych zada. Jego zaawansowane komponenty zapewni Ci komfortow obsug kadego dnia. Praca z arkuszami kalkulacyjnymi od teraz bdzie bardziej wygodna dziki dostpnej klawiaturze numerycznej. \n', , 'Intel Core i5', '16 ', '1 TB SSD', 'AMD Radeon Graphics', 'Windows 11 Professional\n', 1, 1333, 8);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(13, 'Extensa BETA 3', 'Ten komputer gamingowy to potna maszyna, stworzona do zapewnienia niezwykle pynnego i immersyjnego dowiadczenia podczas grania. Wyposaony w najnowoczeniejsze podzespoy, takie jak wysokowydajny procesor, mocn kart graficzn i du ilo pamici RAM, gwarantuje doskona jako obrazu i wydajno.\n\n\n', , 'Intel Core i7', '32 ', '512 GB HDD', 'Intel Iris Xe Graphics', 'Brak', 1, 4435, 34);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(14, 'BMW M5 POOR', 'BMW M5 to potny komputer gamingowy, ktry zapewnia niesamowite doznania podczas grania. Wyposaony w najnowoczeniejsze podzespoy, takie jak mocny procesor, wysokiej klasy karta graficzna i dua ilo pamici RAM, ten komputer jest gotowy do obsugi najnowszych i najbardziej wymagajcych gier. Dodatkowo, elegancki design i solidna konstrukcja sprawiaj, e BMW M5 to nie tylko potne narzdzie do gier, ale take stylowe uzupenienie kadego biurka.\n', , 'Intel Core i9', '64 ', '512 GB SSD', 'Intel UHD Graphics', 'Windows 10 Home', 1, 8019, 20);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(15, 'BIAA MEWA ', 'Biaa Mewa mosiny komputer gamingowy, ktry dostarcza niesamowitego wraenia podczas rozgrywki. Wyposaony w najnowsze podzespoy i wydajny procesor, Biaa Mewa zapewnia pynn i niezakcon gr nawet w najbardziej wymagajcych tytuach. Ponadto, jego designerska biaa obudowa z subtelnymi elementami morskiej tematyki sprawia, e jest to nie tylko potna maszyna, ale rwnie estetyczne dzieo sztuki. Zapewnij sobie najlepsze dowiadczenie w grach dziki Biaej Mewie, dostpnej w Techkomie!\n', , 'Intel Core i3', '8 ', '1 TB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Professional\n', 1, 3442, 490);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(16, 'CAPRIO JAPKO x360 830 G9', 'Zapewnij wszechstronno swojemu ulubionemu miejscu pracy, dziki komputerowi CAPRIO JAPKO x360 830 G9. Ten laptop klasy korporacyjnej oferuje nowe funkcje telekonferencji CAPRIO Presence oraz wydajno i bezpieczestwo, ktrymi mona atwo zarzdza w hybrydowych rodowiskach pracy.\n', , 'Intel Core i5', '16 ', '240 GB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Home', 2, 2837, 369);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(17, 'IMBECYL 17\' Y2', 'Techkom prezentuje nowoczesny laptop gamingowy, idealny dla pasjonatw gier. Wyposaony w najnowszy procesor i wydajn kart graficzn, zapewnia pynne i realistyczne doznania podczas rozgrywki. Precyzyjna klawiatura, odwieajcy ekran o wysokiej rozdzielczoci oraz system chodzenia to tylko niektre z cech tego potnego urzdzenia. Gotowy na wyzwania wirtualnego wiata, ten laptop z pewnoci speni oczekiwania najbardziej wymagajcych graczy.\n', , 'Intel Core i9', '64 ', '512 GB SSD', ' NVIDIA GeForce RTX 4060', 'Windows 10 Home', 2, 4281, 381);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(18, 'ZONEO 984/19 ST', 'ZONEO 984/19 ST to perfekcyjny laptop gamingowy dostpny w Techkom. Wyposaony w potny procesor i kart graficzn, zapewnia niezrwnan wydajno i pynne dziaanie nawet najnowszych gier. Dodatkowo, laptop posiada du i szybk pami RAM oraz pojemny dysk SSD, ktry zapewnia byskawiczne adowanie danych. Ekran o wysokiej rozdzielczoci z technologi IPS gwarantuje niesamowity obraz o ywych kolorach.\n', , 'Intel Core i7', '8 ', '1 TB SSD', 'NVIDIA GeForce GTX 1660 Super', 'Windows 11 Professional\n', 2, 5171, 51);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(19, 'SPECTRE GACUS', 'SPECTRE GACUS to wszechstronny laptop gamingowy, dostpny w ofercie Techkom. Wyposaony w potny procesor, zapewnia niesamowit wydajno podczas grania w najnowsze tytuy. Jego zaawansowany system chodzenia sprawia, e moesz cieszy si nieprzerwan rozgrywk przez dugie godziny. Atrakcyjny wygld, penoekranowy ekran o wysokiej rozdzielczoci oraz mocne karty graficzne to tylko niektre z jego zalet.\n', , 'Intel Core i3', '32 ', '512 GB SSD', 'Intel UHD Graphics', 'Brak', 2, 9879, 388);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(20, 'HELI X KOPTER', 'Techkom przedstawia nowy komputer gamingowy HELI X KOPTER - idealny wybr dla pasjonatw gier! Wyposaony w potny procesor, najnowsz kart graficzn i szybki dysk SSD, ten komputer zapewnia pynne i niezakcone dowiadczenie rozgrywki. Jego imponujca pami RAM i pojemno dysku twardego gwarantuj przechowywanie wszystkich Twoich ulubionych gier. Ponadto, solidna obudowa i wyjtkowy design nadaj temu komputerowi gamingowemu efektowny wygld.\n', , 'Intel Core i7', '16 ', '2 TB HDD', ' NVIDIA GeForce RTX 4060', 'Brak', 1, 5657, 392);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(21, 'Router TP-Link MR200', 'Wykorzystaj pene moliwoci sieci 4G LTE dziki routerowi Archer MR200, ktry potrafi osign prdkoci pobierania a do 150Mb/s. Archer MR200 pozwala udostpni sie 4G LTE wielu urzdzeniom jednoczenie aby mg cieszy si filmami, szybkim pobieraniem plikw oraz czatem wideo bez przeszkd.', , NULL, NULL, NULL, NULL, NULL, 3, 204, 66),
(22, 'TP-Link Archer C6', 'Archer C6 rozgasza dwie oddzielne sieci bezprzewodowe w pasmach 2,4GHz i 5GHz, zapewniajc bardzo wysok wydajno pocze bezprzewodowych. Daje to moliwo jednoczesnego korzystania z dwch dedykowanych sieci bezprzewodowych, o prdkociach odpowiednich dla nawet najbardziej wymagajcych zastosowa.', , NULL, NULL, NULL, NULL, NULL, 3, 190, 112);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(23, 'ASUS RT-AX53U', 'ASUS RT-AX53U to dwuzakresowy router Wi-Fi AX1800 pracujcy w standardzie Wi-Fi 6 (802.11ax). Urzdzenie obsuguje technologie MU-MIMO i OFDMA, z pakietem zabezpiecze sieciowych AiProtection napdzanym przez Trend Micro. RT-AX53U obsuguje pasmo 80 MHz oraz modulacj 1024-QAM, dziki czemu oferuje o wiele wysze prdkoci pocze bezprzewodowych. Zapewnia rwnie czn szybkoci transferw sieciowych na poziomie okoo 1800 Mb/s  574 Mb/s na pamie 2,4 GHz oraz 1201 Mb/s na pamie 5 GHz.', , NULL, NULL, NULL, NULL, NULL, 3, 321, 34),
(24, 'ASUS RT-AX58U', 'Signij po standard Wi-Fi nowej generacji zapewniajcy przepustowo nawet 3000 Mb/s. ASUS RT-AX58U to dwuzakresowy router Wi-Fi 2x2 obsugujcy najnowszy standard 802.11ax, zapewniajc tym samym wiksz przepustowo i stabilno poczenia, przy podczeniu wielu urzdze sieciowych jednoczenie. Przy tym znaczco poprawia bezpieczestwo Twoje i Twoich bliskich podczas korzystania z Internetu, wykorzystujc w tym celu najnowsze rozwizania na rynku.', , NULL, NULL, NULL, NULL, NULL, 3, 428, 88);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(25, 'Cudy X6', 'Router Cudy X6 to dwuzakresowe urzdzenie, ktre dziaa w technologii Wi-Fi 6. Dziki temu zapewnia due prdkoci zarwno w pamie 5 GHz, jak i 2,4 GHz. Producent wyposay go w dwurdzeniowy procesor oraz wydajne anteny, dziki czemu router dziaa sprawnie i zapewnia stabilny sygna. Dynamiczny DNS uatwia zdalne zarzdzanie routerem. Ponadto urzdzenie obsuguje liczne zabezpieczenia jak np. WPA3.', , NULL, NULL, NULL, NULL, NULL, 3, 219, 9),
(26, 'ASUS RT-AX57', 'Z atwoci wdr sie Wi-Fi 6 w swoim domu i ciesz si stabilnymi oraz niezawodnymi poczeniami z routerem ASUS RT-AX57. Wysoka przepustowo oraz liczne technologie wspieraj obsug wielu urzdze jednoczenie na duym obszarze. Rozszerz zasig i rozbuduj sie dziki wsparciu dla rozwizania ASUS AiMesh. Dbaj o bezpieczestwo z AiProtection oraz atwo monitoruj i zarzdzaj sieci z poziomu aplikacji mobilnej.', , NULL, NULL, NULL, NULL, NULL, 3, 422, 43);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(27, 'TP-Link Archer AX72 Pro', 'Z atwoci obsuguj dziesitki urzdze do przesyania strumieniowego i grania w tym samym czasie z routerem TP-Link Archer AX72 Pro. Ten wielogigabitowy router WiFi 6 AX5400 z portem 2.5G zapewnia prdkoci dochodzce do 5400 Mb/s w dwch pasmach, zapewniajc pynn transmisj i szybsze prdkoci pobierania.', , NULL, NULL, NULL, NULL, NULL, 3, 234, 45);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(28, 'Logitech G502 HERO', 'Myszka gamingowa Logitech G502 HERO to potna mysz do gier, ktra oferuje cay zestaw funkcji dla graczy. Zaawansowany czujnik optyczny zapewniajcy maksymaln precyzj ledzenia ruchw, podwietlenie RGB z moliwoci dostosowania, niestandardowe profile gier i ciarki z moliwoci zmiany pozycji. To wszystko sprawia, e Mysz do gier G502 HERO jest odpowiednim narzdziem, aby podj wyzwanie.\r\n\r\nSprawd, jak produkt wyglda w rzeczywistoci. Chwy zdjcie poniej i przecignij je w lewo lub prawo aby obrci produkt lub skorzystaj z przyciskw nawigacyjnych.\r\n\r\n', , NULL, NULL, NULL, NULL, NULL, 4, 62, 92),
(29, 'Genesis Xenon 220 G2', 'Czsto grasz przy komputerze do pnych godzin nocnych a klikanie myszki irytuje pozostaych domownikw? Dziki myszce Genesis Xenon 220 moesz to zmieni. Urzdzenie wyposaono w ciche przeczniki przyciskw redukujce pozom haasu do minimum, zapewniajc spokojny sen pozostaej czci lokatorw. Do tego ergonomiczny ksztat myszki zapewni komfort podczas dugich godzin uytkowania.', , NULL, NULL, NULL, NULL, NULL, 4, 89, 40);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(30, 'SteelSeries Rival 5', 'Poznaj SteelSeries Rival 5  ergonomiczn mysz z 9 programowalnymi przyciskami. Stworzona z myl o maksymalnej szybkoci zapewni Ci przewag w grach typu: Battle Royale, FPS, MOBA, MMO. Dziki bogatemu wyposaeniu przeniesiesz swj gaming na wyszy poziom. Graj precyzyjnie i intensywnie z nowoczesnym sensorem TrueMove Air i przecznikami Golden Micro IP54. Poczuj prawdziw lekko, brak oporu i opanuj rozgrywk bez najmniejszych problemw.', , NULL, NULL, NULL, NULL, NULL, 4, 53, 100);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(31, 'Beyerdynamic DT770 Pro', 'Praca z dwikiem wypenia Twj czas? Jeli tak to seria profesjonalnych suchawek DT880 PRO jest wanie dla Ciebie. Bez wzgldu na to, czy robisz to profesjonalnie w studio nagraniowym, czy w zaciszu pokoju Tworzysz wasne covery lub filmiki, model ten wietnie sprawdzi si w masteringu, czy monitorowaniu dwiku.', , NULL, NULL, NULL, NULL, NULL, 4, 635, 245);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(32, 'Logitech G PRO X Lightspeed', 'Logitech G PRO X Lightspeed to bezprzewodowy zestaw suchawkowy dla graczy, dziki ktremu bdziesz sucha jak profesjonalista i brzmia jak profesjonalista. Zestaw ten pozwoli Ci cieszy si dwikiem i gosem najwyszej jakoci, korzystajc z wygody stabilnego poczenia bezprzewodowego 2,4 GHz. Czysto rozmw zapewni technologia mikrofonu Blue VO!CE*. Dziki niej poczujesz si bardziej pewnie, komunikujc si z innymi graczami.', , NULL, NULL, NULL, NULL, NULL, 4, 534, 46);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(33, 'HyperX Cloud Alpha', 'HyperX Cloud Alpha to suchawki o przeomowej dwukomorowej konstrukcji, zapewniajcej wiksz wyrazisto dwiku i mniej znieksztace. Podwjne komory pozwalaj oddzieli basy od tonw rednich i wysokich, umoliwiajc optymalne dostrojenie i czystsze, bardziej zrwnowaone brzmienie. Suchawki Cloud Alpha doskonale wpisuj si w tradycj wydajnoci i komfortu produktw z rodziny HyperX. Zastosowano w nich charakterystyczn czerwon piank z pamici ksztatu, regulowany pak oraz obicie z mikkiej i jeszcze bardziej elastycznej imitacji skry.', , NULL, NULL, NULL, NULL, NULL, 4, 753, 33);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(34, 'Sharkoon Skiller SGH2', 'Suchawki Sharkoon Skiller SGH2 wyposaone zostay w wysokiej jakoci ruchomy mikrofon wielokierunkowy, ktry sprawdzi si nie tylko podczas samotnej sesji przy komputerze, ale rwnie podczas spotkania, na ktrym obecnych jest wiele osb. Pozycj mikrofonu moesz atwo regulowa i dostosowa do wasnych potrzeb.', , NULL, NULL, NULL, NULL, NULL, 4, 557, 92);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(35, 'Silver Monkey X Mandrill', 'Graj i korzystaj z wielu funkcji, jakie oferuje klawiatura Silver Monkey X Mandrill. Wykonana z tworzywa ABS zapewni Ci trwao i odporno na uszkodzenia. Baweniana otoczka kabla sprawi, e si nie zaplta i nie przeszkodzi Ci w swobodnym korzystaniu z klawiatury. Mandrill moesz ustawi w wygodnej i stabilnej pozycji dziki gumowanym nkom. Ma te podprk pod nadgarstki, moliwo blokady klawisza Windows oraz pokrto do sterowania multimediami. Switche rubber dome sprawi, e kade Twoje nacinicie bdzie wygodne i precyzyjne.', , NULL, NULL, NULL, NULL, NULL, 4, 832, 48);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(36, 'Keychron K2 C3H', 'Keychron K2 C3H to wyjtkowa klawiatura pod wzgldem prostoty, jak i wygody uytkowania. Zapewnij sobie odpowiedni komfort pracy w biurze lub w domowym zaciszu. Graj w ulubione gry i ciesz si doskona prac przecznikw mechanicznych z moliwoci ich szybkiej wymiany. Elegancka, kompaktowa i wytrzymaa konstrukcja z aluminiow ram wietnie wpasuje si w przestrze na Twoim biurku. Co wicej, bezprzewodowe dziaanie da Ci pen swobod pracy.', , NULL, NULL, NULL, NULL, NULL, 4, 538, 61);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(37, 'Roccat Magma AIMO', 'ROCCAT Magma to ergonomiczna klawiatura gamingowa, ktr charakteryzuje wysoka jako wykonania, niezawodno i szybki czas reakcji. To cechy, dziki ktrym odniesiesz sukces. Jej funkcjonalno oraz konstrukcja dostosowana jest typowo do gamingu. Klawiatura ROCCAT Magma pomoe Ci odmieni losy rozgrywki na Twoj korzy.', , NULL, NULL, NULL, NULL, NULL, 4, 967, 24);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(38, 'Sony PlayStation 5', 'Konsola Sony PlayStation 5 Slim stwarza niewyobraalne do tej pory moliwoci rozgrywki. Ultraszybki dysk SSD zapewnia byskawiczne czasy wczytywania. Wykorzystujc moc procesora niestandardowego, procesora graficznego i dysku SSD ze zintegrowanym We/Wy, stworzono nowe zasady tego, na co sta konsol PlayStation.\r\n\r\nEfekty dotykowe, adaptacyjne efekty Trigger i technologia dwiku 3D* wcign Ci w realistycznie odwzorowany wiat niesamowitych gier nowej generacji na PlayStation. PS5 Slim zapewnia graczom potn technologi gier w eleganckiej, niewielkiej konsoli.', , NULL, NULL, NULL, NULL, NULL, 5, 3446, 357),
(39, 'Microsoft Xbox Series X', 'Przyszo gier wanie nadesza. Na imi jej Xbox Series X. W tej konsoli, w ramach architektury XboX Velocity, dokonaa si gboka integracja zaplecza sprztowego z oprogramowaniem.\r\n\r\nOwocem tej fuzji jest niespotykana dotd dynamika gier oraz realizm inspirujcy do nieustannego eksplorowania wirtualnych wiatw. Xbox Series X spenia marzenie o ray tracingu na konsoli, ogromnej wydajnoci, wikszej przestrzeni na gry.', , NULL, NULL, NULL, NULL, NULL, 5, 3565, 218);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(40, 'Microsoft Xbox Series S', 'Oto Microsoft Xbox Series S - konsola nowej generacji, ktra, pomimo e jest o 60% mniejsza od swojego wikszego brata Xbox Series X, posiada komponenty, ktre gwarantuj gaming na najwyszym poziomie. Brak napdu sprawia, e konsola jest w peni cyfrowa, a dysk SSD NVMe o pojemnoci 512 GB i architekturze Xbox Velocity nie tylko pomieci Twoje ulubione gry, ale rwnie byskawicznie je wczyta.\r\n\r\nZastosowany w konsoli Xbox Series S mocny ukad graficzny pozwoli na gr w jakoci 1440p przy nawet 120 klatkach na sekund. Ponadto, urzdzenie obsuguje technologi ray tracingu sprawiajc w ten sposb, e gry bd wyrnia si niesamowitym realizmem. Konsola odtwarza take materiay multimedialne w rozdzielczoci 4K.', , NULL, NULL, NULL, NULL, NULL, 5, 8445, 36),
(41, 'Sony PlayStation 4 Slim', 'Poznaj mniejsz i smuklejsz konsol PlayStation 4 Slim. Poza nowym wygldem urzdzenie oferuje graczom niesamowite wraenia wizualne dziki obecnoci grafiki HDR. Pomniejszona wersja PS4 zadziwia nie tylko designem, ale i cichsz prac poczon z niszym poborem mocy. Na tym polu deklasuje poprzednie wersje konsoli. Wszystkie gry, aplikacje, zrzuty ekranu i filmy zapiszesz teraz na dysku o pojemnoci 500 GB.\r\n\r\nSprawd, jak PlayStation 4 wyglda w rzeczywistoci. Chwy zdjcie poniej i przecignij je w lewo lub prawo, aby obrci produkt, lub skorzystaj z przyciskw nawigacyjnych.', , NULL, NULL, NULL, NULL, NULL, 5, 4783, 476);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(42, 'Samsung Galaxy S23', 'Chwytaj dzie i noc. Z zaawansowanym zestawem aparatw w Galaxy S23 w dzie i w nocy zrobisz zdjcia rewelacyjnej jakoci. Wyposaony w matryc o wysokiej rozdzielczoci 50 MP, doskonale utrwalajce wiato piksele, wyapujce wicej wiata oraz optyczn stabilizacj obrazu (OIS) pozwoli Ci zawsze rejestrowa wyrane kadry.', , NULL, NULL, NULL, NULL, NULL, 6, 6672, 353);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(43, 'Smartfon SAMSUNG Galaxy S24 Ul', 'Wkrocz w er Galaxy AI. Uwolnij zupenie nowe poziomy kreatywnoci, produktywnoci i moliwoci dziki Galaxy S24 Ultra. Sprawd, jak dopracowana w najmniejszym szczegle sztuczna inteligencja zadba o to, by kady dzie by jeszcze wygodniejszy.', , NULL, NULL, NULL, NULL, NULL, 6, 4346, 352);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(44, 'Smartfon GOOGLE Pixel 6a', 'Pixel 6a 6/128GB 5G jest niezwykym smartfonem od Google, ktry oferuje uytkownikom niezwyke technologie w kompaktowej i eleganckiej formie. Oferujc szybki procesor, du ilo miejsca na dane i due moliwoci fotograficzne, ten telefon jest idealnym towarzyszem dla kadego, kto szuka wyjtkowych dowiadcze z technologii.', , NULL, NULL, NULL, NULL, NULL, 6, 2335, 21);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(45, 'Smartfon APPLE iPhone 13', 'Innowacyjny system dwch aparatw zosta zaaranowany na nowo, przesuwajc obiektywy o 45 stopni. Dziki temu nowy szerokoktny obiektyw moe robi jeszcze wspaniae zdjcia i filmy w warunkach sabego owietlenia. Ultraszerokoktny obiektyw obejmuje szersz ramk, dziki czemu uchwycisz jeszcze wicej.', , NULL, NULL, NULL, NULL, NULL, 6, 3516, 99);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(46, 'Smartfon XIAOMI Redmi Note 12 ', 'Zaawansowany procesor MediaTek Dimensity 1080, jaki zastosowano w smartfonie XIAOMI, nieustannie dba o wysok wydajno obsugi Twoich aplikacji. Do tego smartfon ma 6 GB pamici RAM. Wyjtkow funkcjonalno pracy sprztu wspiera dodatkowo gotowo procesora do obsugi sieci 5G.', , NULL, NULL, NULL, NULL, NULL, 6, 3678, 42);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(47, 'Smartfon MOTOROLA Moto G32', 'Smartfon MOTOROLA MOTO G32 czy w sobie wszystkie cechy idealnego urzdzenia mobilnego: du pami, doskona jako dwiku, a take dopracowany wywietlacz i solidny procesor z funkcj usprawniajc zarzdzanie nadmiarem ciepa. Jest on te zabezpieczony czytnikiem linii papilarnych, a codzienne funkcjonowanie uatwi dual SIM z jednoczesnym uyciem karty pamici, NFC do patnoci zblieniowych i dokadna nawigacja satelitarna z obsug AGPS. Nadszed czas, by sprawdzi moliwoci, jakie oferuje ten niezwyky sprzt mobilny.', , NULL, NULL, NULL, NULL, NULL, 6, 8523, 105);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(48, 'Smartfon REALME 11 Pro+', 'Smartfon realme 11 Pro+ 5G zachwyca swoj wydajnoci, zakrzywionym ekranem AMOLED 120 Hz o przektnej 6,7\" oraz aparatem gwnym z matryc OIS SuperZoom 200 MP. Korzystanie z czterokrotnego, bezstratnego zoomu, trybu Fotografii Ulicznej 4.0 oraz trybu Grupowego pozwoli kademu pocztkujcemu amatorowi fotografii cieszy si z uchwyconych momentw. A kiedy chcesz zrobi selfie z przyjacimi, skorzystaj z przedniego obiektywu - 32 MP.', , NULL, NULL, NULL, NULL, NULL, 6, 4299, 403);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(49, 'Smartfon MYPHONE Hammer Blade ', 'BLADE 4 to wytrzymay smartfon peen funkcji nie tylko dla aktywnych w terenie. Jego odporno potwierdzaj certyfikaty IP69 i wojskowy MIL-STD-810G, a pojemna bateria 6150 mAh zapewnia mu dugie dziaanie. S te takie ciekawostki jak system chodzenia, programowalny przycisk czy termometr na podczerwie. Warto te wspomnie o aparacie wysokiej rozdzielczoci, ktrym mona robi zdjcia pod wod.', , NULL, NULL, NULL, NULL, NULL, 6, 8435, 107);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(52, 'Usunicie prawego CTRL\'a', 'Proces usunicia klawisza CTRL po prawej stronie klawiatury bo i tak bdmy szczerzy kto tego uywa. ', , NULL, NULL, NULL, NULL, NULL, 7, 2, 9999);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(53, 'Zdjcie folii z radiatora', 'Kademu moe si zdarzy :) A my naprawimy to za ciebie', , NULL, NULL, NULL, NULL, NULL, 7, 500, 456);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(54, 'Umycie komputera', 'Zakurzony komputer to prawdziwy wstyd przy znajomych. Najlepiej jak wpadnie do nas na szybk kpiel pod myjk cinieniow. Oszczdzisz wtedy czas i energi bo pienidze nie koniecznie.', , NULL, NULL, NULL, NULL, NULL, 7, 214, 547);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(55, 'Pena obsuga asystenta', 'Kady z nas ma przynajmniej jednego czonka rodziny ktry kompletnie nie ogarnia komputerw. Nasz asystent dopomoe w takiej sytuacji a ty bdziesz mg spokojnie gra gdy nasz pracownik zakada mamie konto w aplikacji ROSSMANN', , NULL, NULL, NULL, NULL, NULL, 7, 8999, 5684);
INSERT INTO `produkty` (`id`, `name`, `description`, `image`, `procesor`, `ram`, `dysk`, `gpu`, `system`, `type`, `price`, `popularity`) VALUES
(56, 'Wymiana bulbulatora', 'Najczstszy problem urzdze elektronicznych to uszkodzony bulbulator. Nasz serwis oferuje darmow wymian tego elementu (o ile nie jest on uszkodzony).', , NULL, NULL, NULL, NULL, NULL, 7, 1, 798);
