INSERT INTO `rewiews` (`id`, `username`, `date`, `review`, `rating`) VALUES
(1, 'Pawe Kupiec', '2022-01-19', 'Rakieta, nie komputer! To mj drugi PC \"gotowiec\" od Techkom i kolejny raz si nie zawiodem. Kupujc ten zestaw otrzymujesz gotowy kombajn,\r\nna ktrym tylko instalujesz gr i nie martwisz si o nic - wszystko miga w takiej iloci FPS, e szok. Do tego cao jest bardzo schludnie\r\nzmontowana, no i oczywicie obsuga klienta w x-kom - jak zawsze na najwyszym poziomie. Inne sklepy mog Wam buty liza.', 5),
(2, 'reoberto1124', '2023-05-26', 'Petarda!!! Kupiem po Black Friday za 12100 PLN.\r\nZostaem bardzo pozytywnie zaskoczony specyfik. Szczeglnie t owian tajemnic. Karta MSI, szybszy RAM (3600) oraz zasilacz firmy Be Quiet :)\r\nKalkulowaem przed zakupem ile kosztowaoby mnie zoenie takiego PC. Po sprawdzeniu cen w wikszoci wiodcych sklepw okazao si e same podzespoy wychodziy droej. I to bez systemu operacyjnego!! Posiadam i gram od 2 tygodni w kad gierk na ustawieniach Ultra :) Polecam z czystym sumieniem wzi na raty 0%.', 5),
(3, 'Enderdragon', '2023-11-02', 'wietny serwis. Wczeniej sam skadaem sobie komputery, bo przykadam du wag do optymalnego dobrania podzespow, a wreszcie\r\nznalazem ten sklep. Nie ma co poprawia. wietnie dobrane elementy i profesjonalne ustawienia Biosu. Praca wentylatorw dobrana tak, e\r\npodczas pracy pod Windowsem jest bardzo cicho, dopiero w grach jest goniej, ale wtedy i tak zakadam suchawki. Karta graficzna w grach\r\nbardzo wydajna, gram w rozdzielczoci 3440x1440 bo taki mam monitor. Polecam.', 5),
(4, 'Julka', '2024-01-18', 'Jako prezent urodzinowy dla 16 latka sprawdzi si znakomicie. Szybka realizacja. Wysoka jako i kultura pracy.', 5),
(5, 'Ninebot', '2024-01-04', 'polecam', 5),
(6, 'jurek', '2023-04-04', 'niestety ten komputer pro to nie jest parametry dell inspiron 510 .\n\nszybka wysyka, zwrot pienidzy w terminie .\n\nkomputer ktry zakupiem jest podrobiony, po wpisaniu modelu z informacji w komputerze, nr bios wyskakuje model linux.', 2),
(7, 'zapaa', '2022-10-11', '\"Super sprzt i bardzo dobry kontakt ze sprzedajcym. Polecam\"\r\n\r\nGamingowy Hyperbook LENOVO T480 i7-8th MX150 16GB 512 GB Poleasingowy kl. A', 5),
(8, 'julek231', '2021-02-28', '\"Prosz Pastwa, wspaniali ludzie pracuj tutaj, dopasowali laptopa do moich potrzeb. Dabym sze gwiazdek jakbym mg. Polecam serdecznie. :)\"', 5),
(9, 'polariswodagazowana', '2024-03-21', '\"Polecam. Bardzo dobry kontakt ze sprzedawc. Towar zgodny z opisem. Minus jedna gwiazdka w obsudze kupujcego za zabezpieczenie przesyki. W moim przypadku karton by o ptora razy szerszy od laptopa, przez co ten swobodnie przesuwa si wewntrz przesyki. Foli bbelkowej te mona by uy wicej. Niemniej, laptop dotar do mnie bez uszkodze.\"', 5),
(10, 'popek', '2024-01-29', '\"super sprzedawca!!!!super koks \"', 5),
(12, 'Ivo Lucio Lusaias', '2024-02-01', 'Sklep ten nie honoruje gwarancji. Polskie prawo stanowi, e w przypadku braku jasnego okresu gwarancji gwarancja powinna wynosi 2 lata. Ich obsuga klienta rwnie jest baaganem, wiele osb odpowiedziao na moje roszczenie gwarancyjne, kada z nich inn odpowiedzi, dopki nie zdecydoway si odrzuci bezpodstawnie.', 1),
(13, 'Szampon mski 6w1', '2024-01-16', 'Bardzo mili i pomocni ludzie.\r\n\r\nNa pocztku nie mogem znale sklepu. Oto kierunek:\r\n\r\nJest na pierwszym pitrze. Wic skorzystaj z windy/schodw. Sklep ssiaduje ze sklepem CCC.', 5),
(14, 'Sawek C', '2023-07-12', 'Bardzo le zorganizowane.\r\nZamwiem co przez Internet....Poprosiem o odbir w sklepie.\r\nCzekaem 30 minut, eby to dosta....\r\nMona sobie wyobrazi, e jeli zamwie co przez Internet i otrzymae powiadomienie, e przedmiot jest gotowy, dostawa nie powinna zaj tak duo czasu...', 2.5),
(15, 'jaki rusek', '2023-09-01', 'Jeli chcesz pozosta w kolejce przez cay dzie, zapraszamy do sklepu.', 1),
(16, 'Monikanta w.', '2024-02-04', 'Zamwiem przez internet i pojechaem odebra osobicie. Sklep jest w dobrej lokalizacji, a personel recepcji jest wykwalifikowany i pomocny, chtnie odpowie na Twoje pytania.', 4.5),
(17, 'Sam Maximov', '2023-12-28', 'Zawsze miaem wietne dowiadczenia z TechKom, ale dzi miaem okazj porozmawia z kim, kto nawet nie prbowa mi sprzeda notatnika. Na pewno nie wrc do tego sklepu.', 1),
(18, 'Andrzej', '2024-02-06', 'Kupiem tutaj laptopa Dzisiw. Poniewa zamwiem w przedsprzeday, nie spdziem zbyt wiele czasu, a reakcja bya szybka i szybka', 5),
(19, 'Mateusz Pajk', '2024-02-02', 'Szczeglnie podobao mi si wywietlanie rnych telefonw komrkowych ze wszystkimi potrzebnymi szczegami na ich ekranach.', 5),
(20, 'Lokalny Pan Przewodnik', '2023-12-31', 'Bardzo miy personel, szybka reakcja i dobra jako.', 5),
(21, 'Grzegorz Zdrj', '2013-05-06', 'Bardzo mia obsuga klienta.', 5),
(22, 'cichy informatyk', '2024-07-25', 'Wszystko jest w porzdku, z wyjtkiem dugich kolejek.', 4),
(23, 'Pawe Zontek', '2023-02-16', 'Lubi ten sklep', 4.5),
(24, 'Micha B', '2019-08-15', 'Obsuga z wydajnoci 3 klientw na 30 minut przy pracy 5 stanowisk, hit... stworzenie dedykowanego miejsca do przyjmowania zamwie... banda idiotw na stanowiskach kierowniczych', 1.5),
(25, 'Bosiek PIO', '2020-06-02', 'Sprzedaowo firma w porzdku, jednak jestem w trakcie reklamacji produktu i pierwsze podejcie byo negatywne (karta graficzna wyranie wymaga wymiany termopadw w pamici) i wyglda na to, e obsuga niewiele daa wysiek. A wic sprzeda plus serwis, hmm.\nPrby sprzeday dodatkowych produktw typu Cross-Selling nieco spowalniaj usug (jak ma to miejsce w przypadku wikszoci firm tego typu).\nNiedawno sprzedawca dokona cudu, zachcajc dwie mode dziewczyny do wykupienia dodatkowego ubezpieczenia przy zakupie iPhone\'a  myl, e dotarcie do kasy zajo im okoo pitnastu minut.', 3),
(26, 'Kasia Uran-335', '2019-11-20', 'Czas temu odebraem tablet, a ostatni raz z chopakiem zoyem reklamacj. Wszyscy panowie zawsze s bardzo mili i pomocni. Mj ulubiony salon ze sprztem elektronicznym, na pewno bd wraca. :)', 5),
(27, 'Zoty', '2022-11-07', 'Duy sklep, szeroki wybr produktw\nJednak czas oczekiwania na otrzymanie zamwienia internetowego jest zdecydowanie za dugi.', 3),
(28, 'MczennikSystemu', '2018-08-01', 'Wracajc do czasw, ktre susznie ju miny, po co mie numery, a obsuga i tak idzie jedna po drugiej, na odbir zamwienia czeka si prawie godzin, poza tym, e w tej godzinie pracownicy cigle gdzie znikali i mimo praktycznie 6 stanowisk jednoczenie, w rzeczywistoci byy to tylko 4 stanowiska jednoczenie, przez wikszo czasu 3. We numer i id na zakupy', 1.5),
(29, 'Kaalion', '2022-01-25', 'Niedawno odwiedziem salon, aby odebra zamwienie i jestem bardzo zadowolony. Obsuga na wysokim poziomie, zarwno profesjonalnym, jak i kulturalnym. Obsugiwa mnie bardzo miy Pan Piotr, ktry wykona wietn robot, nie mam adnych zastrzee :)', 5),
(30, 'Karyna', '2024-02-17', 'Straszna obsuga, szczerze polecam kady inny sklep ni ten. Obsuga zachowuje si jak po kilkudniowej imprezie, moe nawet zrobi sobie przerw na rozmow.', 1),
(31, 'Patrycja Rogowieeec', '2016-04-14', 'Zamwienie zostao zoone pod koniec miesica z zapewnieniem, e zostanie dostarczone i zafakturowane do ostatniego dnia miesica. Niestety po wielu interwencjach dostawa zostaa zrealizowana w nastpnym miesicu, co oznacza, e klient otrzymuje obietnice jedynie zoenia zamwienia, a nastpnie zostaje odrzucony', 1),
(32, 'BAJO JAJO', '2015-05-20', 'Musz przyzna, e poziom szybkoci obsugi klientw oraz kwestia oczekiwania na swoj kolej zawstydzia afrykaskich wykonawcw drg i nigeryjsk sub zdrowia. Uwiadomiono mi, e korki w Afryce to nic. Pozdrowienia.', 1),
(33, ' adam2', '2024-02-21', 'zimno', 3.5);

